import React, { Component } from 'react';

class Body extends Component {
    constructor() {
        super();
        this.state = {
            pokemon: []
        };
    }
    componentDidMount() {
        fetch('https://api.reinaldowft.com/pokestore?page=1&limit=150')
            .then(response => response.json())
            .then(data => this.setState({ pokemon: data.results }))
    }

    render() {
        const { pokemon } = this.state;
        return (
            <di>
                <h1>Lista Pokemon</h1>
                <h5>
                    {pokemon.map(pkmn => <div key={pkmn.name}>{pkmn.name}</div>)}
                    {console.log(pokemon)}
                </h5>
            </di>
        )
    }
}

export default Body;
